import React, { Component } from 'react';
import back from './assets/back.png'

class App extends Component {
  render() {
    return (
      <div className="App">
      <div className="w-100 pl3">
        <h1 className="mb0 mt0">
          Daniel
        </h1>
        <h1 className="mb0 mt0">
          Douangkesone
        </h1>
          </div>
        <div className="w-50">
          <div className="absolute bottom-0">
            <img alt="profile" className="w-50" src={back} />
          </div>
        </div>
        <div className="w-50 pl3 fr">
          Hello my name is dan
        </div>
      </div>
    );
  }
}

export default App;
